                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={formData.COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO}
                                                        name="COUNSELLOR_AVAILABILITY_TIME_FRIDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>

                                            <Segment.Group horizontal size="tiny" className="HeadingForAvailability">
                                                <Segment className="customSegment">
                                                    <Label style={{ display: 'block' }}>
                                                        <Checkbox label='Monday' />

                                                    </Label>
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM}
                                                        name="COUNSELLOR_AVAILABILITY_TIME_SATURDAY_FROM"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    />
                                                </Segment>
                                                <Segment className="customSegment">
                                                    <input
                                                        type="time"
                                                        step="1"
                                                        value={formData.COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO}
                                                        name="COUNSELLOR_AVAILABILITY_TIME_SATURDAY_TO"
                                                        className="form-control"
                                                        placeholder="Time"
                                                        onChange={onTimeChangeHandler}
                                                    /></Segment>
                                            </Segment.Group>



                                        </Segment>
                                    </center>
                                </Grid.Column>
                            </Grid.Row>
                        </Grid>
                        <br />
                        <Button
                            color='teal'
                            fluid
                            size='large'
                            onClick={() => navigation.previous()}
                        >
                            Back
                            </Button>

                        <Button
                            color='teal'
                            fluid
                            size='large'
                            type="submit"
                            onClick={() => navigation.next()}
                        >
                            Next
                    </Button>

                    </center>
                </Form>

            </Grid.Column>
        </Grid >
    )

